window.bookSummaryJSON = "<p>An enforcer wanted dead for crimes she didn’t commit.... </p> <p>An assassin wanted dead for crimes he <i>did</i> commit.... </p> <p>Normally, they would be enemies, but they both seek the same thing: exoneration. </p> <p>Unfortunately, a nefarious underground organization is attempting to kill the one man who could grant it to them - the emperor. If they want to win their freedom, they’ll have to battle powerful wizards, outscheme master schemers, and defeat bloodthirsty monsters, all while dodging friendly fire and evading the law. Exoneration isn’t easy. </p> <p>This boxed set includes the first three novels in this high fantasy adventure series: </p> <p><i>The Emperor’s Edge </i></p> <p><i>Dark Currents </i></p> <p><i>Deadly Games</i></p>"; 
